func minimumOperations(num string) int {
    ans := len(num) // Initialize with max possible operations.
    // Iterate over possible endings that make a number special: "00", "25", "50", "75".
    for _, lastTwo := range []string{"00", "25", "50", "75"} {
        pos1, pos2 := -1, -1 // Positions of the last two digits that we are looking for.
        for i := len(num) - 1; i >= 0; i-- {
            if pos2 == -1 && num[i] == lastTwo[1] {
                pos2 = i // Found the last digit position.
            } else if pos2 != -1 && num[i] == lastTwo[0] {
                pos1 = i // Found the second last digit position.
                break
            }
        }
        if pos1 != -1 && pos2 != -1 {
            // Calculate operations needed: total length - positions of digits - 2 (for the two digits we keep).
            ops := (len(num) - 1 - pos2) + (pos2 - 1 - pos1)
            if ops < ans {
                ans = ops // Update minimum operations.
            }
        }
    }
    return ans
}
